import { auth } from "../config/firebase";

export const Main = () => {
    return (
        <div>
            <h1>Home Page</h1>
            { auth != null ? <div>
                <p>{auth.currentUser?.displayName}</p>
                <img src="{auth.currentUser?.photoURL}" alt="no image available" />
            </div> : "You need to Login"}
        </div>
    );
}
